import React from "react";
import styled from "styled-components";
import SearchInput from "../common/SearchInput";

const NavBar = styled.nav`
  width: 100%;
  padding: 20px 10px;
  background: #fbf8f5;
  position: sticky;
  top: 0;
`;

const Header = () => {
  return (
    <NavBar>
      <SearchInput />
    </NavBar>
  );
};

export default Header;
